import React from "react";
import "../css_styles/AdminSidebar.css";
const AdminSidebar = ({ tech }) => {
  return (
    <div className="dashboard">
      <div className="dashboard_header">
        <h2> DASHBOARD </h2>
      </div>
      <div className="dashboard_performance">
        <h2>PERFORMANCE</h2>
        <div className="dashboard_performance_items">
          <div className="dashboard_performance_items1"><h2>Charts</h2></div>
          <div className="dashboard_performance_items1"><h2>Tables</h2></div>
        </div>
      </div>
      <div className="dashboard_pages">
        <h2>PAGES</h2>
        <div className="dashboard_pages_items">
        <div className="dashboard_performance_items1"><h2>Charts</h2></div>
        </div>
      </div>
      <div className="dashboard_info"></div>
    </div>
  );
};

export default AdminSidebar;
